import React, { useState, useEffect } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import TableContainer from '@mui/material/TableContainer';
import Table from '@mui/material/Table';
import TableHead from '@mui/material/TableHead';
import TableBody from '@mui/material/TableBody';
import TableRow from '@mui/material/TableRow';
import TableCell from '@mui/material/TableCell';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import Dialog from '@mui/material/Dialog';
import { Stack } from '@mui/system';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';
import axios from 'axios';

function DepartmentHeadScoreCSB02() {
    const [projects, setProjects] = useState([]);
    const [selectedProject, setSelectedProject] = useState(null);
    const [openDialog, setOpenDialog] = useState(false);

    // Fetch projects and exam scores
    useEffect(() => {
        const fetchProjectData = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Project');
                setProjects(response.data);
            } catch (error) {
                console.error('Error fetching project data:', error);
            }
        };

        const fetchExamScores = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Exam_results');
                if (response.data && Array.isArray(response.data)) {
                    // If you need to process the exam scores data, do it here
                }
            } catch (error) {
                console.error('Error fetching exam scores:', error);
            }
        };

        fetchProjectData();
        fetchExamScores();
    }, []);

    const handleProjectChange = (event) => {
        const selectedID = event.target.value;
        const selectedProject = projects.find(project => project.ID === selectedID);
        setSelectedProject(selectedProject);
    };

    const handleCloseDialog = () => {
        setOpenDialog(false);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            // Your form submission logic
            const response = await axios.post('http://localhost:9999/Exam_results', {
                // Include form data
            });
            console.log('Subject added:', response.data);
            setOpenDialog(true);
        } catch (error) {
            console.error('Error adding subject:', error);
        }
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <div>
                                <Box
                                    fontSize='18px'
                                    sx={{ marginTop: 5 }}
                                >
                                    <h1>แบบประเมินโครงงานพิเศษ 1 (สอบก้าวหน้า)</h1>
                                    <p>เลือกชื่อโครงงาน</p>
                                    <FormControl>
                                        <InputLabel id="project-select-label">Project</InputLabel>
                                        <Select
                                            labelId="project-select-label"
                                            value={selectedProject?.ID || ''}
                                            onChange={handleProjectChange}
                                            label="Project"
                                            margin="normal"
                                            sx={{ minWidth: 150 }}
                                        >
                                            {projects.map((project) => (
                                                <MenuItem key={project.ID} value={project.ID}>
                                                    {project.Name}
                                                </MenuItem>
                                            ))}
                                        </Select>
                                    </FormControl>
                                    <TextField
                                        disabled
                                        label="ชื่อโครงงาน"
                                        value={selectedProject?.Name || ''}
                                        sx={{ '& > :not(style)': { ml: 5, width: '50ch' } }}
                                    />
                                    <br />
                                    <p>โดย</p>
                                    <TextField
                                        label="รหัสนักศึกษาคนที่ 1"
                                        value={selectedProject?.SID || ''}
                                        disabled
                                        sx={{ '& > :not(style)': { mr: 5, ml: 5, width: '25ch' } }}
                                    />
                                    <TextField
                                        label="ชื่อ-สกุลนักศึกษาคนที่ 1"
                                        value={selectedProject?.SName || ''}
                                        disabled
                                        sx={{ '& > :not(style)': { mr: 0, width: '30ch' } }}
                                    />
                                    <br />
                                    <TextField
                                        label="รหัสนักศึกษาคนที่ 2"
                                        value={selectedProject?.SID2 || ''}
                                        disabled
                                        sx={{ '& > :not(style)': { mr: 5, ml: 5, mt: 3, width: '25ch' } }}
                                    />
                                    <TextField
                                        label="ชื่อ-สกุลนักศึกษาคนที่ 2"
                                        value={selectedProject?.SName2 || ''}
                                        disabled
                                        sx={{ '& > :not(style)': { mt: 3, width: '30ch' } }}
                                    />
                                    <p>อาจารย์ที่ปรึกษา</p>
                                    <TextField
                                        label="ชื่ออาจารย์ที่ปรึกษา"
                                        value={selectedProject?.TName || ''}
                                        disabled
                                        sx={{ '& > :not(style)': { mr: 5, ml: 5, width: '25ch' } }}
                                    />
                                </Box>
